import { MenuProps, SECTION } from "../App";
import { ConnectionsIcon } from "../icons/ConnectionsIcon";
import "../styles/menu.css";

export default function Menu({ section, setSection }: MenuProps) {
  return (
    <div className="menu-container">
      <div className="menu">
        <div
          className="game-card"
          onClick={() => setSection(SECTION.CONNECTIONS)}
        >
          {ConnectionsIcon}
        </div>
        <div className="game-card" onClick={() => setSection(SECTION.STRANDS)}>
          {StrandsIcon}
        </div>
      </div>
    </div>
  );
}
